Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (174,'농심)무파마큰사발컵','82578514-227d-4e3b-9f7f-45433a2a08bd.jpg','식품','용기면,가공식사','무파마탕면은 천연재료인 무와 파, 마늘을 넣어 국물이 시원한 소고기장국맛 제품',1800);
Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (175,'농심)너구리소컵','e0930bc9-b150-438f-ab4d-263a29b0db83.jpg','식품','용기면,가공식사','얼큰하고 개운한 해물베이스의 국물맛과 오동통한면발이 조화를 이룬 제품으로 풍성한 미역과 청정해역에서 채취한 국내산 다시마가 국물에 한층 개운함과 감칠맛을 더해줍니다. 기존의 컵면에서 볼 수 없었던 오동통통한 면발이 특징입니다.',1150);
Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (176,'농심)사천짜파게티','b025d79d-11b3-40f3-82b9-89d3cd10d27a.jpg','식품','봉지면,가공식사','고추 추출유와 고춧가루를 유성스프 및 과립스프에 각각 첨가하여 짜장소스와 자연스럽게 어울리는 향긋하고 감칠맛 나는 매콤한 맛이 특징',1400);
Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (177,'농심)오징어짬뽕','478d020f-b91e-4cdf-a841-d72c15eabdd6.jpg','식품','봉지면,가공식사','① 정통중화풍 짬뽕의 맛을 라면으로 손쉽고 간편하게 즐기실 수 있는 오징어짬뽕 ② 오징어가 들어가 더 개운하고 얼큰한 국물 맛은 오징어 건더기의 쫀득하게 씹히는 맛과 어울려 먹는 즐거움을 더해 줍니다.',1200);
Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (178,'농심)신라면','20b9bae0-614a-49b1-bf64-c6fe808efb08.jpg','식품','봉지면,가공식사','① 소고기를 주원료로 완전진공 농축 시킨 소고기 엑기스에 각종 천연 양념을 잘 조화시켜 만든, 전통 가정요리로부터 유래된 얼큰한 소고기국 맛의 제품 ② 1986년 10월에 개발된 이후 꾸준한 사랑을 받고 있는 신라면',950);
Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (179,'농심)짜파게티','82091af9-d91c-49b5-8ed5-62adbd2495fa.jpg','식품','봉지면,가공식사','면발이 굵고 부드러우며 쫄깃쫄깃하고, 춘장, 양파 등을 볶아 만든 짜장스프가 들어있어 고소하고 진한 정통적인 짜장면의 맛',1200);
Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (180,'농심)신라면소컵','없음','식품','용기면,가공식사','붉은 고추의 매콤한 맛과 진한 소고기 국물맛이 잘 조화 된 한국인 입맛에 꼭 맞는 제품입니다.',1150);
Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (181,'농심)신라면큰사발컵','c9ff843e-f5b9-4f68-9d6c-32d1674fdd8a.jpg','식품','용기면,가공식사','대한민국 대표라면 신라면 큰사발면으로 간편하고 푸짐하게 국내 최고의 인기 라면인 辛라면을 큰사발 형태의 용기면으로 개발한 辛라면 큰 사발면입니다.',1400);
