Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (183,'농심)너구리얼큰','f7ab3309-fd9c-4522-9d87-9bb1e34607a4.jpg','식품','봉지면,가공식사','① 1982년 출시된 이래 지금까지 꾸준히 사랑을 받고 있는 농심의 장수브랜드 ② 깊고 개운한 국물맛과 오동통하고 쫄깃한 면발이 특징 ③ 국내산 다시마 건더기로 맛과 영양을 더해주는 너구리만의 개성을 더해줌',1100);
