Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (657,'제이)반반한닭갈비300g','2a3ebb2d-c9cc-4aea-bf9d-c323842bb19b.jpg','식품','반찬류,식재료','[CU단독] ①닭갈비계의 짬짜면, 달콤한 찜닭 화끈한 닭갈비를 한번에! ②떡도 들어있어 푸짐하게 ③스트레스 날려줄 화끈한 매운 닭갈비 ④안동식찜닭소스의 짭짤하고 달짝지근한 맛',5900);
