Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (1244,'만인산)팽이버섯150g','4382905b-e7c3-4cbc-b5a8-89f2ca0e30f8.jpg','식품','채소,식재료','[CU 단독] 요리에 한가득 넣어도 부담스럽지않고 쫄깃한 버섯. 국이나 전골요리에 훌륭한 포인트 . 베이컨 돌돌만 팽이버섯요리는 도시락반찬, 술안주 등으로 손색없답니다.',1600);
Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (1245,'만인산)오이1입','d5459bec-b9a4-476f-b857-7a15b2d4b0e5.jpg','식품','채소,식재료','[CU 단독] 시원한 맛을 지닌 수분이 풍부한 오이 고추가루 양념에 버무려 오이소박이, 무침 등 밑반찬으로 즐겨보세요 오래두고 피클이나 장아찌 담가도 좋답니다.',2000);
Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (1246,'만인산)깐양파2입','88d09834-31a5-4d66-b072-ecdeeea4761c.jpg','식품','채소,식재료','[CU 단독] 집에 없으면 아쉬울 정도로 다양한 음식에 활용되는 양파 단단하고 중량감 있는 양파만을 선별해 공급받고 있습니다.',2900);
Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (1247,'만인산)깐마늘120g','cb2148bb-cf42-4509-ad08-b5472a6603c2.jpg','식품','채소,식재료','[CU 단독] 튼실한 알맹이만을 선별해 껍질을 깔끔하게 제거한 뒤 지퍼백에 쏙 포장했어요. 사용하고 남은 마늘까지 깔끔하게 보관해 신선하게 사용해보세요.',2600);
Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (1248,'만인산)적상추100g','97873527-6ab1-40d6-a6be-d6cd7c05f548.jpg','식품','채소,식재료','[CU 단독] 금강상류 청정지역에서 재배한 신선한 상추 고기를 구워 먹을 떄 없으면 허전한 쌈채소 특유의 쌉싸름한 끝맛으로 입안을 깔끔하게 해줌',2400);
Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (1249,'만인산)절단대파300g','5209ed6c-b428-414f-8cb8-592ee9c3b395.jpg','식품','채소,식재료','[CU 단독] 아삭하고 향긋한 파는 여러 요리에서 빼놓을 수 없는 식재료 남은 파 물러서 버리는 경우없이 손질대파로 즐겨보세요 육수 내거나 개운한 맛을 더할때 편리하게 사용해보세요',3400);
Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (1250,'만인산)오이맛고추250g','f78eabf3-d80e-4d5f-8859-ad44f04b2ef0.jpg','식품','채소,식재료','[CU 단독] 아삭하고 시원한 아삭이 고추, 열매가 크고 과피가 두껍습니다. 아삭하고 시원한 아삭이 고추 일반 고추보다 열매가 크고 과피가 두껍습니다. 쌈장에 찍어 구운 고기와 함께 즐기세요',4200);
Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (1251,'만인산)깻잎30g','ec77da6f-9067-4d7a-911f-3d0b418dc6e5.jpg','식품','채소,식재료','[CU 단독] 잎이 진하고 두꺼워 향이 진한 추부깻잎. 칼슘과 철분, 무기질 풍부 우리나라의 대표적인 향채소, 상큼하고 쌉쌀한 향기 덕분에 없던 입맛도 돌아오게 하는 감초 역할 칼슘과 무기질, 철분, 비타민 A와 C가 풍부합니다.',2000);
Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (1252,'만인산)애호박1입','3a703140-4412-40ec-bb3d-ece352f847b7.jpg','식품','채소,식재료','[CU 단독] 냉장고 속, 만능 식재료 애호박. 부드러운 식감과 단맛이 일품입니다. 노릇노릇 애호박전과 구수한 된장찌개. 볶음반찬까지 가능한 단골 식재료 부담없는 양, 합리적인 가격으로 만나보세요',2300);
Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (1253,'만인산)청양고추100g','49291b4c-b03d-4f20-bfb2-d5ff9b7dd6ca.jpg','식품','채소,식재료','[CU 단독] 맛과 식감이 우수하며 특유의 매운맛으로 입맛을 돋구는 효과가 있습니다. 코 끝이 얼얼해지는 향과 맛 청양고추 찌개, 무침, 조림 등 요리에 매콤한 맛을 돋우거나 쌈장에 콕 찍어 생으로 드시면 신선하고 알싸한 청양고추',2300);
Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (1254,'프레)차돌박이숙주볶음','dcf3a943-50ee-40e6-b241-a3a1542d1cde.jpg','식품','냉장밀키트,가공식사','촘촘하고 마블링이 살아있는 신선한 차돌박이가 들어간 꿀맛, 차돌박이 숙주볶음',12900);
Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (1255,'프레)그레이프스테이크','0dad7a08-a72f-444e-b202-b322593b5904.jpg','식품','냉장밀키트,가공식사','스테이크와 너무나 잘어울리는 향긋한 포도소스, 일품 요리를 간편하게!',16900);
