Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (1342,'구르메)앙상블치즈초리조','e5cdf706-c847-4bd1-99b5-7d0a24147a8c.jpg','식품','치즈,식재료','정통 스페인 초리조(Espuna 제품)와 고다가 들어가 정통 재료의 맛을 살린 치즈,짭조름한 맛 속에 부드러운 치즈 향이 느껴짐. 초리조가 들어가 약간 붉은 색을 띄는 치즈 큐브 색상 (초리조 엑스트라 7% 함유), 크래커 또는, 취향에 따라 마리네이드 토마토, 올리브 등과 함께 핑거 푸드로 활용.',7900);
