Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (1999,'사옹원)한끼잡채210g','1a3b2314-fb69-48f8-a49a-069390cedc41.jpg','식품','간편식,가공식사','각종 야채와 표고버섯 액기스, 참기름을 둘러 풍부하고 고소한 맛의 잡채',4100);
Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (2000,'CJ)비비고추어탕460g','c05dcf8f-eedc-4e40-9706-33391a8bac2e.jpg','식품','2+1,탕류,가공식사','여름철 보양식! 국산 미꾸라지를 가득 담은 비비고 남도식추어탕! 산초, 들깨가루로 풍미를 살리고 생강으로 잡내를 잡은 깔끔한 맛',7900);
