Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (2003,'CJ)비비고순댓국460g','941d5622-0bc0-49cb-89b1-83dbbad50533.jpg','식품','2+1,국류,가공식사','돼지고기, 염통 등이 어우러진 건더기, 속이 꽉 찬 고기 순대를 푸짐하게 담은 비비고 사골순댓국',7900);
