Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (2005,'삼양)불닭볶음탕면','4ff6f3d1-bc29-474d-b3d6-527439e49c0a.jpg','식품','봉지면,가공식사','국물타입으로 더욱 화끈하게 즐길 수 있는 불닭볶음탕면. 두껍고 쫄깃한 면발과 국물까지 있는 제대로 된 한 끼!',1800);
Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (2006,'대상)복음사과시나몬잼','70c541af-d926-4729-997f-64d146de3726.jpg','식품','소스류,식재료','국산 사과를 사용한 사과잼으로 풍성한 원물감을 그대로 느낄 수 있습니다. 사과를 다이스로 잘라 넣어 씹는 식감과 과육의 상큼함이 살아있으며, 시나몬의 풍미를 함께 느낄 수 있습니다.',6000);
