Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (2025,'오뚜기)김치전믹스320g','7d6415b5-ca5e-449a-accc-af27235c4ca6.jpg','식품','식재료','① 김치와 반죽믹스가 들어있어서, 다른 재료 필요 없이 물만 부어 섞은 후 부치면 되는 초간편 김치전 믹스 ② 김치전 지름 20cm 2장이 나오는 양으로, 집에 김치를 상비해 놓지 않거나, 부침가루를 사놓으면 항상 남는 1~2인가구에게 딱!',8300);
