Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (2028,'CJ)더건강한그릴후랑크2입','6abd01c3-0fef-446a-a4a1-3d3418cdfbc8.jpg','식품','2+1,핫바,안주류','신선한 돼지고기로 속을 꽉 채워 톡 터지는 식감과 육즙이 가득! 순돈육 90.45 %로 속을 가득 채워, 고기 씹는 맛을 제대로 살렸습니다.',3900);
