Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (2680,'롯데)허쉬쿠앤크초콜릿40g','5402a1e4-6deb-4686-848a-30585d20a7c0.jpg','과자류','2+1,초콜릿','세계적으로 유명한 허쉬사의 화이트 판초콜릿. 고급스럽고 부드러운 맛의 화이트 초콜릿에 바삭한 쿠키가 사이사이 박혀있어 달콤함을 더하고, 바삭한 식감을 제공함',1600);
