Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (2682,'롯데)허쉬아몬드초콜릿40g','24ddbdef-efb1-4c22-aecd-76545941d1cf.jpg','과자류','2+1,초콜릿','몸에 좋은 아몬드와 허쉬 밀크초콜릿의 만남 통아몬드의 고소함과 영양이 고스란히 부드러운 밀크초콜릿 중간중간에 박혀있어 씹히는 식감이 좋음',1600);
Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (2683,'삼경)하리보골드바렌100g','cb68482e-9048-4d41-986b-70e7c2e8537c.jpg','과자류','젤리,소프트캔디','유명한 곰돌이 모양 젤리로 천연향과 천연재료를 사용한 과일향 젤리. 과즙이 첨가된 6가지 과일맛(사과,오렌지,라즈베리,산딸기,레몬,파인애플)',2000);
