Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (3176,'서영)홀스비타C라임','a40a6499-ac3e-472c-a6ee-e7a402b3c39e.jpg','과자류','기능성캔디','130년 역사의 글로벌 캔디 브랜드 호올스의 강력한 휘산작용과 Vita C함유로 건강하고 과일맛의 상큼함을 동시에 느낄 수 있습니다.',1000);
