Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (3179,'마즈)스키틀즈요거트향','80cba506-e70b-41eb-b815-b1db00cc5598.jpg','과자류','소프트캔디','① 5가지 요거트맛[요거트, 딸기요거트, 망고요거트, 파인애플요거트, 베리요거트맛] ② 트렌디한 파스텔톤 디자인으로 여성타겟 공략 ③ 다양한 색상과 맛으로 골라먹는 재미',1500);
Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (3180,'참조은)끼리치즈스틱케익','bca9ca9c-4833-426a-8db5-bc726662986f.jpg','과자류','냉동디저트','프리미엄 끼리 크림치즈를 듬뿍 더해 입 안 가득 부드럽고 깊은 맛의 치즈케익을 스틱 타입으로 더욱 깔끔하고 편리하게 즐길 수 있습니다. 전세계적으로 부드럽고 순수한 맛으로 유명한 프랑스 프리미엄 Kiri 크림치즈 50.7% 함유.',2600);
