Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (3182,'해태)오사쯔맛탕60g','50d31bf5-83f0-45d8-bd16-f5bcc8d237c8.jpg','과자류','스낵,과자류','꾸덕한 식감과 진한 향을 구현하기 위한 당액코팅을 한 오사쯔 맛탕스낵. 검은볶음깨를 뿌려 고소함이 가득하며, 냉동증숙고구마 13.3% 함유로 리얼 고구마맛 구현.',1500);
