Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (3475,'대두)우유찰떡','426547e8-dd52-452e-81d0-4b8fafb4b42d.jpg','과자류','냉장디저트,디저트','★CU단독★ CU에서만 만날 수 있는 화과방 찰떡2입. 카스테라 고물이 묻혀진 말랑한 떡 속에 달콤한 우유필링이 가득 들어있는 디저트 크림찰떡.',1800);
Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (3476,'명도)미주라시리얼비스켓','6de23e42-39b8-49c3-88dc-6a53be301da8.jpg','과자류','비스켓,과자류','1. 4가지 곡물(밀,스펠트,쌀,옥수수)가 들어간 고소한 비스켓입니다. 2. 설탕의 대체감미료인 말티톨시럽을 사용하여 은은하게 달콤한 비스켓입니다. 3. 30g 당 130Kcal로 다이어터들의 치팅 아이템으로 유명합니다. 4. 나뭇잎 모양의 예쁜 비스켓으로 아이스크림, 요거트 등을 통해 2차레피시 구성도 가능합니다.',3000);
Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (3477,'명도)미주라허니비스켓','84a57306-3238-4418-87dd-a4d1a3493e69.jpg','과자류','비스켓,과자류','1. 꿀이 들어가 은은한 달콤함이 특징인 비스켓입니다. 2. 계란과 우유가 들어가지 않아 알러지가 있는 고객도 안심하고 드실 수 있습니다. 3. 보존료, 착색료가 들어가지 않고 트랜스지방, 콜레스테롤이 ZERO인 비스켓입니다.',2500);
