Insert into FOOD.CU_TBL (ID,FOOD_NAME,FOOD_IMG,FOOD_TYPE1,FOOD_TYPE2,FOOD_DETAIL,FOOD_PRICE) values (5455,'하이)하이네켄논알콜캔330','79314006-b473-475c-ab52-e7a1e24f69e0.jpg','음료','탄산음료,음료','1. A-Yeast로 두 번 양조하고 발효시켜 자연적으로 알콜을 제거한 하이네켄 최초의 논알콜 맥주 2. 부담없이 즐길 수 있는 저칼로리 (69Kcal) 논알콜 맥주 3. 하이네켄 오리지널과 동일한 맥주공정을 거쳐 프리미엄 맥주에서 느낄 수 있는 몰트를 풍부하게 표현한 논알콜 맥주',3500);
